window.bookSummaryJSON = "<p>The greatest discovery in human history may also be our last.</p> <p>Dr. Jack Greer's startling discovery beneath the Gulf of Mexico proved to the world we were not alone in the universe. But when images from the <i>Voyager One</i> space probe reveal an alien doomsday ship hurtling toward the Earth, the human race seems marked for extinction.</p> <p>As news of the approaching ship spreads panic around the globe, signs of a sinister plot begin to emerge - one that threatens to unravel the already fragile fabric of society and everything Jack and Dr. Mia Ward have fought for.</p> <p>But could a mysterious signal emanating from inside Greenland's ice sheet unlock the secrets hidden within our genome and prevent humanity's destruction?</p> <p>From the frozen fields of Greenland to the bustling Indian subcontinent and the cobbled streets of Rome, the race is on to stop the deadliest countdown to extinction the human race has ever known.</p>"; 
